import MSFTSubheading, { SubheadingSize, SubheadingTag, } from "./subheading";
import subheadingSchema from "./subheading.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { SubheadingStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Subheading = manageJss(SubheadingStyles)(MSFTSubheading);
export { Subheading, SubheadingSize, SubheadingTag, subheadingSchema, };
